import React from 'react';
import {Switch , Router} from 'react-router-dom';
import First from './first.js';
import Second from './second.js';    

const Main=()=>(
  <Switch>
      <Route path="/" component={First.js}/>
      <Route path="/component2" component={Second.js}/>
      <Route path="/component3" component={First.js}/>

  </Switch>
)

export default Main;
